.globl main
main:
    	 
	li $t2, BASE_ADDRESS
	li $t4, MAX_ADDRESS
	
	li $t1, 0xffffff # $t1 stores current color
	                   # Defult: White
    
    # The register Below is very important
    # It stores the address of the screen being printed
    li $t6, 0

load_splash_screen:
    # =====================================================
    la $t6, SplashScreen 
    buildStartupMenu:
     	
     	lw $t1, 0($t6)    # Loads pixel from image
     	sw $t1, 0($t2)    # Puts pixel into bitmap
    	addi $t2, $t2, 4  # Move to next position on bitmap
    	addi $t6, $t6, 4  # Move to next position on image
    	
    	bne $t2, $t4, buildStartupMenu # stop -> position = max_address
 
    SLEEP:
    # The following syscall makes the MIPS sleep for 3 seconds
    li $v0, 32 
    li $a0, INTERVAL
    syscall
    
    # =====================================================
    # Builds Credits Screen
    la $t6, CreditsScreen 
    li $t2, BASE_ADDRESS
        buildCreditsScreen:
         	lw $t1, 0($t6)    # Loads pixel from image
         	sw $t1, 0($t2)    # Puts pixel into bitmap
        	addi $t2, $t2, 4  # Move to next position on bitmap
        	addi $t6, $t6, 4  # Move to next position on image
        	bne $t2, $t4, buildCreditsScreen # if not at max -> restart loop
 
    SLEEP2:
    # The following syscall makes the MIPS sleep for 3 seconds
    li $v0, 32
    li $a0, INTERVAL
    syscall
    
    # =====================================================
    MainMenuHyperJump:
    # Builds Main Menu
    li $s2, 0 # Set Game State to 0 (menu functions)
    li $t3, 0 # Set our first toggle to 0
    LoadMainMenuPlay:
    la $t6, MainMenuPlay
    li $t2, BASE_ADDRESS
        buildMainMenu:
         	beq $t2, $t4, KEYBOARD # stop -> position = max_address
         	lw $t1, 0($t6)    # Loads pixel from image
         	sw $t1, 0($t2)    # Puts pixel into bitmap
        	addi $t2, $t2, 4  # Move to next position on bitmap
        	addi $t6, $t6, 4  # Move to next position on image
        	
        	j buildMainMenu
        # =====================================================
        # =====================================================
 	KEYBOARD:
 	       jal checkKeyboardInput
 	       li $v0, 32
    	       li $a0, 33
   	       syscall
               j KEYBOARD
        WSpressed: 
        	  beq $t3, 0, GotoEXIT
        	  beq $t3, 1, GotoPLAY
        	  
        GotoPLAY: li $t3, 0
        	  j LoadMainMenuPlay 
        	  
        GotoEXIT: la $t6, MainMenuExit
        	  li $t2, BASE_ADDRESS
        	  li $t3, 1
        	  j buildMainMenu  
        	  
	SelectCurrent:
		  beq $t3, 0, ControlHintScreen
    	  beq $t3, 1, END
		  
		  
		  
		  
		  
	ControlHintScreen:
	# Builds Hint Screen
    la $t6, HINTSCREEN 
    li $t2, BASE_ADDRESS
        buildControlHintScreen:
         	lw $t1, 0($t6)    # Loads pixel from image
         	sw $t1, 0($t2)    # Puts pixel into bitmap
        	addi $t2, $t2, 4  # Move to next position on bitmap
        	addi $t6, $t6, 4  # Move to next position on image
        	bne $t2, $t4, buildControlHintScreen # if not at max -> restart loop
 
			# The following syscall makes the MIPS sleep for 3 seconds
			li $v0, 32
			li $a0, INTERVAL
			syscall
			j PrepLogicOne
			
			
       	# =====================================================
       	# We loop this label continously unless the plater pressed P (pause)
        # On every Loop we check the following:
        #   
        #   
        #   Current Level -> t6
        #   
        #   
        #   
        #   
        #   Keyboard Input (if none we move on).
        #   - if yes (we update player location)
        #   Collision detection for player:
        #   - if player is on platform (thenn skip to end of loop)
        #   - if player is on platform (then use gravity loop)
        #
        #   Restart gamelogicloop
       	# =====================================================
   PrepLogicOne:
       	li $s2, 1 			# Set Game State to 1 (In-Game Functions)
       	li $s0, 46 		   	# Y -> s0
    	li $s1, 21 		   	# X -> s1
    	li $t9, 0			# 0 Bullets
    	li $a3, 0			# No Firing
    	li $s7, 0 			# GAME SCORE
    	li $s3, 2			# Jumps Available (Resets to 2 when we hhit floor)
    	li $s4, 0			# Game Time Counter for Dissapearing Platforms
    	li $s6, 1           # Looking Direction
    LevelOneLogic:
      

	

	
    addi $s4, $s4, 1		# One Frame+
    	beq $s4, 50, VanishPlatform
    	beq $s4, 100, UnVanishPlatform
    	beq $s4, 150, RedPlatform
    	j NoVanish
    	#####################################################################
    	RedPlatform:
    	li $s4, 0			# Reset Timer
    	bne $s2, 5, NoVanish 		# If level not built -> dont erase prev char
        
        
        li $t6, LAVA		# Load Level Image -> t6
    	li $t2, BASE_ADDRESS
    	li $t3, 0	
    	li $t7, 23492
	add $t2, $t2, $t7         	# Jumps to calculated address for Platform
    	ChnageColorPlatform:
    		
    		sw $t6, 0($t2)     	# Paint pixel to bitmap
    		addi $t2, $t2, 4   	# Move to next position on Bitmap
		addi $t3, $t3, 1	# +1
    		bne $t3, 7, ChnageColorPlatform # 7 pixels not Removed yet

    		j NoVanish
    	UnVanishPlatform:
    	bne $s2, 5, NoVanish 		# If level not built -> dont erase prev char
        
        
        li $t6, BLACK		# Load Level Image -> t6
    	li $t2, BASE_ADDRESS
    	li $t3, 0	
    	li $t7, 23492
	add $t2, $t2, $t7         	# Jumps to calculated address for Platform
    	BringBackPlatform:
    		
    		sw $t6, 0($t2)     	# Paint pixel to bitmap
    		addi $t2, $t2, 4   	# Move to next position on Bitmap
		addi $t3, $t3, 1	# +1
    		bne $t3, 7, BringBackPlatform # 7 pixels not Removed yet

    		j NoVanish
    	VanishPlatform:
    	
    	bne $s2, 5, NoVanish 		# If level not built -> dont erase prev char
        
        
        li $t6, FLOOR		# Load Level Image -> t6
    	li $t2, BASE_ADDRESS
    	li $t3, 0	
    li $t7, 23492
	add $t2, $t2, $t7         	# Jumps to calculated address for Platform
    	ErasePlatform:
    		
    		sw $t6, 0($t2)     	# Paint pixel to bitmap
    		addi $t2, $t2, 4   	# Move to next position on Bitmap
		addi $t3, $t3, 1	# +1
    		bne $t3, 7, ErasePlatform # 7 pixels not Removed yet
    	NoVanish:
    	
    	# Win Heli Proximity =====================================
    	#===Heli========================
    	bne $s7, 4, SkipHeliProx		#If s7 is not 4 then we skip heli Prox
        	li $t7, 5
        	blt $t7, $s0, HeliOne
        	j SkipHeliProx
	HeliOne:
		li $t7, 18	
		blt $s0, $t7, HeliOne2
		j SkipHeliProx
