    		add $t2, $t2, 4		# Increment Base Address to our Location
    		sw $t1, 0($t2)		# load our color there
    		li $t1, PICKUPIN	# Load Yellow Color
    		
    		add $t2, $t2, 4	# Increment Base Address to our Location
    		sw $t1, 0($t2)		# load our color there
    		#=======================
    		li $t2, BASE_ADDRESS
    		addi $s0, $s0, 1 #Y
    		addi $s1, $s1, 1 #X
    		jal caladdressFUNC
    		add $t2, $t2, $s5	# Increment Base Address to our Location
    		sw $t1, 0($t2)		# load our color there
    		
    		#2
    		li $t1, PICKUP	# Load Yellow Color
    		add $t2, $t2, 4		# Increment Base Address to our Location
    		sw $t1, 0($t2)		# load our color there
    		li $t1, PICKUPIN	# Load Yellow Color
    		
    		add $t2, $t2, 4	# Increment Base Address to our Location
    		sw $t1, 0($t2)		# load our color there
    		#=======================
    		li $t2, BASE_ADDRESS
    		addi $s0, $s0, 1 #Y
    		addi $s1, $s1, 1 #X
    		jal caladdressFUNC
    		add $t2, $t2, $s5	# Increment Base Address to our Location
    		sw $t1, 0($t2)		# load our color there
		
		# Get ra from stack
		lw $ra, 0($sp)
		addi $sp, $sp, -4
		jr $ra
		
caladdressFUNC:
    # Y -> s0
    # X -> s1
    # calculate address
    li $s5, 0 # Reset Final Answer Register
    mul $s5, $s0, 128 # Y * Width
    add $s5, $s5, $s1 # + X
    mul $s5, $s5, 4 # (y*width + x)* 4
    # Final Address -> s5
    
    jr $ra
    
checkKeyboardInput:
    li $t5, 0xffff0000
    lw $t8, 0($t5)                      #
    beq $t8, 0, Jumptocaller     	# Check if Keyboard is Pressed
    lw $t8, 4($t5)                      # Load Pressed Key
    
    beq $s2, 0, menufunctions
    beq $s2, 1, InGamefunctions
    beq $s2, 5, InGamefunctions
	beq $s2, 20, PauseScreen
    j Jumptocaller
    menufunctions:
        beq $t8, 0x77, WSpressed 	# w
        beq $t8, 0x57, WSpressed 	# W
        beq $t8, 0x73, WSpressed 	# Change pointing to Exit s
        beq $t8, 0x53, WSpressed 	# Change pointing to Exit S
        beq $t8, 0x0A, SelectCurrent 	# Enter Key Pressed
        j Jumptocaller
    InGamefunctions:
        beq $t8, 0x77, jump 		# w
        beq $t8, 0x57, jump 		# W
        beq $t8, 0x64, walkForward	# d
        beq $t8, 0x44, walkForward	# D
        beq $t8, 0x61, walkBackwards	# a
        beq $t8, 0x41, walkBackwards	# A
        beq $t8, 0x66, fire		# f
        beq $t8, 0x46, fire		# F
	beq $t8, 0x70, PAUSE		# p
	beq $t8, 0x50, PAUSE		# P
        beq $t8, 0x72, restartGame	# r (Restart Game)
        beq $t8, 0x52, restartGame	# R (Restart Game)
        beq $t8, 0x71, END		# q (END Game)	
        beq $t8, 0x51, END		# Q (END Game)	
		j Jumptocaller
    PauseScreen:
		beq $t8, 0x70, RESUME
		j Jumptocaller
    Jumptocaller: jr $ra
    
LOSE:	
	li $s0, 5
	la $t6, DEFEAT5
	j STARTDEFEAT
	four:
	la $t6, DEFEAT4
	j STARTDEFEAT
	three:
	la $t6, DEFEAT3
	j STARTDEFEAT
	two:
	la $t6, DEFEAT2
	j STARTDEFEAT
	one:
	la $t6, DEFEAT1 
	
	STARTDEFEAT:
	li $t2, BASE_ADDRESS
	
        buildDefeatScreen:
         	lw $t1, 0($t6)    # Loads pixel from image
         	sw $t1, 0($t2)    # Puts pixel into bitmap
        	addi $t2, $t2, 4  # Move to next position on bitmap
        	addi $t6, $t6, 4  # Move to next position on image
        	bne $t2, $t4, buildDefeatScreen # if not at max -> restart loop
        	subi $s0, $s0, 1
        	
        	# Score ================================================
        	beq $s7, 0, updateScoreZero2		# Score Zero 
    		beq $s7, 1, updateScoreOne2		# Score One
    		beq $s7, 2, updateScoreTwo2		# Score Two
    		beq $s7, 3, updateScoreThree2		# Score Three
    		beq $s7, 4, updateScoreThree2		# Go To Helicopter
    		updateScoreZero2: la $t6, ZeroScore
    				j SetupScoreLogic2
    		updateScoreOne2: la $t6, OneScore
    				j SetupScoreLogic2
    		updateScoreTwo2: la $t6, TwoScore
    				j SetupScoreLogic2
   		updateScoreThree2: la $t6, ThreeScore
    				j SetupScoreLogic2

   		SetupScoreLogic2:
    			li $t2, BASE_ADDRESS
    			addi $t2, $t2, 3804
    			li $t3, 0				# Layer Helper Horizontal
    			li $t7, 12				# Layer Helper Vertical
       			ScoreUpdate2:
         			lw $t1, 0($t6)    		# Loads pixel from image
         			sw $t1, 0($t2)    		# Puts pixel into bitmap
         	
         			addi $t2, $t2, 4  		# Move to next position on bitmap
        			addi $t6, $t6, 4  		# Move to next position on image
        		
         			addi $t3, $t3, 1		#t3 + 1 Horizontal
         			bne $t3, 12, ScoreUpdate2
         			li $t3, 0			# t3 = 0
         			subi $t7, $t7, 1		#t7 + 1 Vertical
         			addi $t2, $t2, 464  		# Move to next position on bitmap
         			bne $t7, 0, ScoreUpdate2
         	#=========================================
        	# The following syscall makes the MIPS sleep for 1 seconds
    		li $v0, 32
    		li $a0, INTERVALEND
    		syscall
        	beq $s0, 4, four 
        	beq $s0, 3, three
        	beq $s0, 2, two
        	beq $s0, 1, one
        	beq $s0, 0, DefeatLoadingScreen
        	
        	
       	DefeatLoadingScreen:
        la $t6, LOADING 
	li $t2, BASE_ADDRESS
        buildLoadingScreen:
         	lw $t1, 0($t6)    # Loads pixel from image
         	sw $t1, 0($t2)    # Puts pixel into bitmap
        	addi $t2, $t2, 4  # Move to next position on bitmap
        	addi $t6, $t6, 4  # Move to next position on image
        	bne $t2, $t4, buildLoadingScreen # if not at max -> restart loop
        	
        	# The following syscall makes the MIPS sleep for 3 seconds
    		li $v0, 32
    		li $a0, INTERVALEND
    		syscall
    		
    		j MainMenuHyperJump
PauseTheGame:
# ======Pause Screen======================================	
	# Store $ra to stack
	addi $sp, $sp, 4
    sw $ra, 0($sp)
	
	la $t6, PAUSEIMG
    	li $t2, BASE_ADDRESS
    	li $t3, 0	# Layer Helper Horizontal
    	li $t7, 12	# Layer Helper Vertical
        Loop10:
         	lw $t1, 0($t6)    	# Loads pixel from image
         	sw $t1, 0($t2)    	# Puts pixel into bitmap
         	
         	addi $t2, $t2, 4  # Move to next position on bitmap
        	addi $t6, $t6, 4  # Move to next position on image
        	
         	addi $t3, $t3, 1	#t3 + 1 Horizontal
         	bne $t3, 12, Loop10
         	li $t3, 0		# t3 = 0
         	subi $t7, $t7, 1	#t7 + 1 Vertical
         	addi $t2, $t2, 464  # Move to next position on bitmap
         	bne $t7, 0, Loop10
			
		PauseTheGameLoop:
		# The following syscall makes the MIPS sleep
    		li $v0, 32
    		li $a0, FPS
    		syscall
		
		jal checkKeyboardInput
		
		
		j  PauseTheGameLoop
	
		RESUME:
		lw $ra, 0($sp)
    	addi $sp, $sp, -4
		
		
		jr $ra



        	
END: 	
    # Builds Exit Screen
    la $t6, ExitScreen 
    li $t2, BASE_ADDRESS
        buildExitScreen:
         	lw $t1, 0($t6)    # Loads pixel from image
         	sw $t1, 0($t2)    # Puts pixel into bitmap
        	addi $t2, $t2, 4  # Move to next position on bitmap
        	addi $t6, $t6, 4  # Move to next position on image
        	bne $t2, $t4, buildExitScreen # if not at max -> restart loop
 		EXIT:
 		li $v0, 10 # terminate the program gracefully
		syscall
